import { StatusBar } from "expo-status-bar";
import React from "react";
import {
  StyleSheet,
  Text,
  TouchableOpacity,
  Image,
  View,
  SafeAreaView,
} from "react-native";

export default function App() {
  const handlePress = () => console.log("I pressed it");
  console.log(require("./assets/icon.png"));
  return (
    <SafeAreaView style={styles.container}>
      <Text>USC Visitors App</Text>

      <TouchableOpacity
        onPress={() => console.log("hello")}
        style={{ background: "dodgerblue", height: 400, width: 500 }}
      >
        <Image
          source={require("./assets/undrawMap.png")}
          style={{
            height: 300,
            width: 400,
            filter: "dropshadow(2px 3px 10px #black)",
          }}
        />
      </TouchableOpacity>

      <Text onPress={handlePress}>David, Sarah, Morice</Text>
      <StatusBar style="auto" />
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
});
